import React, { useState, useEffect } from "react";
import './GetDining.css';


const GetDining = () => {

    const [restaurants, setRestaurants] = useState([]);
    const [fastfoods, setFastfoods] = useState([]);

    const getRestaurants = async(id, price) => {
            const response = await fetch("http://localhost:8000/restaurant" + `/${id}` + `/${price}`);
            const jsonData = await response.json();
            setRestaurants(jsonData);
    };

    const getFastfoods = async() => {
            const response = await fetch("http://localhost:8000/fastfood");
            const jsonData = await response.json();

            setFastfoods(jsonData);
    };

    useEffect(() => {
        getFastfoods();
    });

    return (
        <>
            <div className="ops-box-container">
                <div className="left-text-container">
                    <h2>Restaurants</h2>
                    <p>Choose a park:   </p>
                        <select id="parkhours">
                            <option value="default">Park Number</option>
                            <option value="1">1</option>
                            <option value="2">2</option>
                            <option value="3">3</option>
                            <option value="4">4</option>
                            <option value="5">5</option>
                        </select>
                        <button >Submit</button>
                        <table id="restaurant">
                            <thead>
                            <tr>
                                <th>Park #</th>
                                <th>Name</th>
                                <th>Cuisine</th>
                                <th>Price</th>
                                <th>Seats</th>
                            </tr>
                            </thead>
                            <tbody>
                            {restaurants.map(restaurant => (
                                                <tr>
                                                    <td>{restaurant.park_id}</td>
                                                    <td>{restaurant.name}</td>
                                                    <td>{restaurant.cuisine}</td>
                                                    <td>{restaurant.price}</td>
                                                    <td>{restaurant.seats}</td>
                                                </tr>
                                            ))}

                            </tbody>
                        </table>
                </div>



                <div className="right-text-container">
                    <h2>Fast Food</h2>
                        <table id="fastfood">
                            <thead>
                            <tr>
                                <th>Park #</th>
                                <th>Name</th>
                                <th>Type</th>
                                <th>Price</th>
                            </tr>
                            </thead>
                            <tbody>
                            {fastfoods.map(fastfood => (
                                                <tr>
                                                    <td>{fastfood.park_id}</td>
                                                    <td>{fastfood.name}</td>
                                                    <td>{fastfood.type}</td>
                                                    <td>{fastfood.price}</td>
                                                </tr>
                                            ))}

                            </tbody>
                        </table>
                </div>

            </div>   
        </>
    )
};

export default GetDining;
